angular.module('com.module.core')
.directive('visualizeVectors', visualizeVectorsDirective);

function visualizeVectorsDirective() {
  return {
    restrict: 'E',
    scope: {
      sliderMax: '@',
      sliderMin: '@',
      clusters: '=',
      vectorType: '@' //image or text
    },
    link: link,
    templateUrl: '/app/partials/slider'
  };
}

function link(scope, elem, attrs) {
  scope.$watch('clusters', newValue => {
    if (newValue)
      updateGraph(newValue);
  });

  scope.sliderValue = scope.sliderMax / 2;

  scope.sliderChanged = function() {
    updateGraph(scope.clusters);
  };

  function updateGraph(clusters) {
    clusters = scope.clusters.filter(c => c.data_type === attrs.vectorType);
    scope.clustersCount = clusters.length;

    graphClustersVectors({
      clusters,
      maxIndex: scope.sliderValue
    });
  }

  function graphClustersVectors(args) {
    let {clusters, maxIndex} = args;

    if (scope.scatterplotSvg)
      scope.scatterplotSvg.remove();

    if (_.isEmpty(clusters)) return;

    let $container = elem.parent(),
      margin = {top: 20, right: 20, bottom: 30, left: 40},
      width = $container.width(),
      height = $container.height(),
      innerWidth = width - margin.left - margin.right,
      innerHeight = height - margin.top - margin.bottom,
      color = d3.scaleOrdinal().range(d3.schemeCategory20),
      minDim = Math.min(width, height),
      vectors = _(clusters).map('average_similarity_vector')
        .compact().value();
      // vectors = window.test.vectors
      vectors = vectors.slice(0, maxIndex - 1)

    let svg = d3.select($container[0]).append('svg')
      .attr('width', '100%')
      .attr('height', '100%')
      .attr('viewBox', [0, 0, minDim, minDim])
      .attr('preserveAspectRatio','xMinYMin');

    scope.scatterplotSvg = svg;

    let graph = svg.append('g')
      .attr('transform', 'translate(' + [margin.left, margin.top] + ')');

    // let zoom = d3.zoom()
    //   .scaleExtent([-40, 40])
    //   .on('zoom', zoomed);

    // svg.call(zoom);

    // function zoomed() {
    //   dots.attr('transform', d3.event.transform);
    // }

    let xScale = d3.scaleLinear()
      .domain([0, maxIndex])
      .range([0, innerWidth]);

    let yScale = d3.scaleLinear()
      .domain(d3.extent(vectors[0]))
      .range([innerHeight, 0]);

    let xAxis = d3.axisBottom(xScale),
      yAxis = d3.axisLeft(yScale);

    // TODO: .nice() ??

    graph.append('g')
      .attr('class', 'x axis')
      .attr('transform', 'translate(0,' + innerHeight + ')')
      .call(xAxis)
    .append('text')
      .attr('class', 'label')
      .attr('x', innerWidth)
      .attr('y', -6)
      .style('text-anchor', 'end')
      .text('idx');

    graph.append('g')
      .attr('class', 'y axis')
      .call(yAxis)
    .append('text')
      .attr('class', 'label')
      .attr('transform', 'rotate(-90)')
      .attr('y', 6)
      .attr('dy', '.71em')
      .style('text-anchor', 'end')
      .text('value');

    // nested array -> nested selection
    let dots = graph.selectAll('.dots')
      .data(vectors)
    .enter()
      .append('g')
      .attr('class', 'dots')
      .attr('fill', function(d, i) { return color(i); })
      .selectAll('circle')
      .data(function(d) { return d; })
    .enter().append('circle')
      .attr('class', 'dot')
      .attr('r', 5)
      .attr('cx', function(d, i) {
        return xScale(i);
      })
      .attr('cy', function(d, i) {
        return yScale(d);
      });
  }
}
